//Converts a valid pgm file to an sk file. If an sk file with the
// same name as the file that is going to be written exists, it is overwritten.
// Note the filename should be in the form ("$.pgm"). Where $ represents some name.
void pgmToSk(char fileName []){
  const int NO_PGM_TO_SK_FUNCTIONS = 4;
  //Note following functions work but not used due to fact that lines are anti-aliased with SDL2:
  //rleXLinePgmToSk, rleYLinePgmToSk
  //Note, other functions were created, but to reduce runtime, only the best one(s) is(/are) used.
  //(Other functions I have created may actually perform better on different images)
  sk* (*pgmToSk[]) (image* img) = {blockyPgmToSk, qTreePgmToSk, perPixelPgmToSk, rleXBlockPgmToSk};
  image * img = newImageFromPgm(fileName); //Converts pgm file to an array of real numbers
  sk * sketchFile;
  sk *bestFile = (*pgmToSk[0]) (img);//Stores the best sketch file value
  //Loops through all compression algorithms and selects the best one to store the resulting file.
  for(int i = 1; i < NO_PGM_TO_SK_FUNCTIONS; i++){
    sketchFile = (*pgmToSk[i]) (img);
    if(noInstructions(bestFile) > noInstructions(sketchFile)){
      freeSk(bestFile);
      bestFile = sketchFile;
    }else{
      freeSk(sketchFile);
    }
  }
  writeSkToFile(fileName, bestFile, true);
  freeImage(img);
  freeSk(bestFile);
}

//Checks that the filename is a .sk file that points to a valid file.
bool isValidSkFileName(const char fileName[]){
  //Checks that filename is of form "$.sk"
  int len = strlen(fileName);
  if(len <= 3) return false;
  if(fileName[len - 1] != 'k' || fileName[len - 2] != 's' || fileName[len - 3] != '.') return false;
  //Checks that name only contains one dot.
  int noDots = 0;
  for(int i = 0; i < len; i++){
    if(fileName[i] == '.') noDots++;
  }
  if(noDots != 1) return false;
  //Checks that the filename points to an actual file.
  FILE *fp = fopen(fileName,"rb");
  if(fp == NULL) return false;
  fclose(fp);
  return true;
}

//Checks that the file contents are all valid instructions (or that the file is empty).
bool isValidSkFileContents(const char fileName[]){
  FILE *fp = fopen(fileName, "rb");
  fseek(fp, 0, SEEK_SET);
  byte c = fgetc(fp);
  while(!feof(fp)){
    //For the tool instruction, only certain operands are valid.
    if(getOpcode(c) == TOOL){
      if((getOperand(c) > 8) || (getOperand(c) < 0)) return false;
    }
    c = fgetc(fp);
  }
  fclose(fp);
  return true;
}

//Checks to see whether the file selected is a valid sk file.
bool isValidSkFile(const char fileName []){
  if(!isValidSkFileName(fileName)) return false;
  return isValidSkFileContents(fileName);
}

//Converts an rbga colour to its equivalent pixel brightness value.
//Note alpha values are ignored.
static inline float getPixelVal(unsigned int rgba){
  unsigned int red = (rgba >> 24) & 0xFF;
  unsigned int green = (rgba >> 16) & 0xFF;
  unsigned int blue = (rgba >> 8) & 0xFF;
  double new = (double)(red + green + blue) / 3.0;
  float val = (float)round(new);
  return val / 255.0f;
}

//Draws block to image struct.
void drawBlock(image *img, sk*ins, byte blockIns){
  int tyNew = ins->currState->ty + getOperand(blockIns); //Gets target y value
  int width = getAbs(ins->currState->tx - ins->currState->x);
  int height = getAbs(tyNew - ins->currState->y);
  int endX = (ins->currState->x + width) % (MAX_WIDTH + 1); //Max x ending is 200
  int endY = (ins->currState->y + height) % (MAX_HEIGHT + 1); //Max y ending is 200
  float newPixelVal = getPixelVal(ins->currState->colour);
  if(width != 0 && height != 0){//No drawing actually occurs for widths and heights of 0
    for(int y = ins->currState->y; y < endY; y++){
      for(int x = ins->currState->x; x < endX; x++){
        img->pixels[y][x] = newPixelVal;
      }
    }
  }
}

//Draws line to image structure.
//Sets pixel to state colour for every pixel that intersects with line.
void drawLine(image *img, sk*ins, byte lineIns){
  int tyNew = (ins->currState->ty + getOperand(lineIns)) % (MAX_HEIGHT + 1); //Gets target y value
  float newPixelVal = getPixelVal(ins->currState->colour);
  int lowerX = ins->currState->tx < ins->currState->x? ins->currState->tx : ins->currState->x;
  int upperX = ins->currState->tx > ins->currState->x? ins->currState->tx : ins->currState->x;
  int lowerY = tyNew < ins->currState->y? tyNew : ins->currState->y;
  int upperY = tyNew > ins->currState->y? tyNew : ins->currState->y;
  int y1 = ins->currState->y;
  int y2 = tyNew;
  int x1 = ins->currState->x;
  int x2 = ins->currState->tx;
  if((x2 == x1) && (y1 == y2)) return; //No line to be drawn
  /*When the line is horizontal or vertical, the gradients are undefined
  when used in the context of cartesian equations for x or y coordinates.
  Thus, these cases are handled specially*/
  if(tyNew == ins->currState->y){ //Horizontal line
    for(int x = lowerX; x <= upperX; x++){
      img->pixels[ins->currState->y][x] = newPixelVal;
    }
  }else if(ins->currState->x == ins->currState->tx){ //Vertical line
    for(int y = lowerY; y <= upperY; y++){
      img->pixels[y][ins->currState->x] = newPixelVal;
    }
  }else{
    // Uses m = (y_2 - y_1) / (x_2 - x_1), y = mx + c, y = mx + (y_1 - mx_1), x = (y - c) / m
    double m = (double)(y2 - y1) / (double)(x2 - x1);
    double c = ((double)y1 - (m * (double)x1));
    double y,x;
    //Loops through all y values to find corresponding pixels
    for(int yInt = lowerY; yInt <= upperY; yInt++){
      x = (((double)yInt) - c) / m;
      img->pixels[yInt][(int)floor(x)] = newPixelVal;
    }
    //Loops through all x values to find corresponding pixels
    for(int xInt = lowerX; xInt <= upperX; xInt++){
      y = (m * ((double)xInt)) + c;
      img->pixels[(int)floor(y)][xInt] = newPixelVal;
    }
  }
}

//Updates a sketch state and image given an instruction.
void updateImage(image *img, sk*ins, byte newInstruction){
  //If opcode is dy, and tool is a draw function, image needs to be updated.
  if(getOpcode(newInstruction) == DY && (ins->currState->tool == LINE || ins->currState->tool == BLOCK)){
    //As image is in range [0, 0] -> [199, 199], operations outside of this range are ignored
    if(ins->currState->x < 0 || ins->currState->x >= MAX_WIDTH || ins->currState->y < 0
    || ins->currState->y >= MAX_HEIGHT || ins->currState->ty < 0 || ins->currState->ty > MAX_HEIGHT
    || ins->currState->tx > MAX_WIDTH || ins->currState->tx < 0){
    }else{
      if(ins->currState->tool == BLOCK){
        drawBlock(img, ins , newInstruction);
      }else if(ins->currState->tool == LINE){
        drawLine(img, ins, newInstruction);
      }
    }
  }
  addInstruction(ins, newInstruction);
}

//Writes an image structure to a pgm file.
void writeImgToPgmFile(image *img, const char fileName[]){
  const int LEN_FILE_START = 15;
  const char FILE_START [] = {'P', '5', ' ', '2', '0', '0', ' ', '2', '0', '0', ' ', '2', '5', '5','\n'};
  FILE *fp = fopen(fileName, "wb");
  fseek(fp, 0, SEEK_SET);
  //Writes default start to file
  for(int i = 0; i < LEN_FILE_START; i++){
    fputc(FILE_START[i], fp);
  }
  int pixelVal;
  //Writes necessary bytes to file
  for(int y = 0; y < MAX_HEIGHT; y++){
    for(int x = 0; x < MAX_WIDTH; x++){
      pixelVal = (int)round(img->pixels[y][x] * 255.0f);
      fputc(pixelVal, fp);
    }
  }
  fclose(fp);
}

// Converts a valid sk file to a pgm file.
void skToPgm(const char fileName [], bool printConfirmation){
  sk *ins = newSk();
  image *img = newImage(); //Stores resulting image.
  FILE *fp = fopen(fileName, "rb");
  fseek(fp, 0, SEEK_SET);
  byte c = fgetc(fp);
  while(!feof(fp)){//Reads each instruction and updates image accordingly
    updateImage(img, ins, c);
    c = fgetc(fp);
  }
  fclose(fp);
  //Converts filename (of the form $.sk) to $.pgm.
  char outFile [strlen(fileName) + 2];
  outFile[strlen(fileName) + 1] = '\0';outFile[strlen(fileName)] = 'm';
  outFile[strlen(fileName) - 1] = 'g';outFile[strlen(fileName) - 2] = 'p';
  outFile[strlen(fileName) - 3] = '.';
  bool term = false;
  for(int i = 0; (i < strlen(fileName)) && !term; i++){
    if(fileName[i] == '.'){
      term = true;
    }else{
      outFile[i] = fileName[i];
    }
  }
  writeImgToPgmFile(img, outFile);//Writes to file
  if(printConfirmation) printf("File %s has been written.\n", outFile);
  freeSk(ins);
  freeImage(img);
}

