  assert(__LINE__, isValidPgmFileName(".pgm") == false);
  assert(__LINE__, isValidPgmFileName("aed.pgm.pgm") == false);
  assert(__LINE__, isValidPgmFileName("aedpgm") == false);
  assert(__LINE__, isValidPgmFileName("aed.") == false);
  assert(__LINE__, isValidPgmFileName("") == false);
  assert(__LINE__, isValidPgmFileName("hello.pgml") == false);
