//Tests the function that sets the data
void testSetData(){
  const int FIRST_EIGHT_BITS = 0xFF;
  sk *s = newSk();
  assert(__LINE__, s->currState->data == 0);
  int maxIndex = MAX_WIDTH > MAX_HEIGHT? MAX_WIDTH: MAX_HEIGHT;
  maxIndex = maxIndex > 255? maxIndex : 255;
  //Set data command will primarly be used to set tx and ty values as well as colours.
  //All of these values are tested.
  float col;
  for(int i = 0; i <= maxIndex; i++){
    if(i <= 255){
      col = (float)i / 255.0f;
      setData(s, getColour(col));
      assert(__LINE__, (s->currState->data & FIRST_EIGHT_BITS) == 0xFF);
      assert(__LINE__, ((s->currState->data >> 8) & FIRST_EIGHT_BITS) == i);
      assert(__LINE__, ((s->currState->data >> 16) & FIRST_EIGHT_BITS) == i);
      assert(__LINE__, ((s->currState->data >> 24) & FIRST_EIGHT_BITS) == i);
    }
    setData(s, i);
    assert(__LINE__, s->currState->data == i);
  }
  freeSk(s);
}

//Tests the function that sets the target x value.
void testSetTx(){
  sk *s = newSk();
  //Tests that setting target x works for all combinations
  //of a starting tx value and a final tx value.
  for(int startTx = 0; startTx <= MAX_WIDTH; startTx++){
    setTx(s, startTx);
    assert(__LINE__, s->currState->tx == startTx);
    for(int endTx = 0; endTx <= MAX_WIDTH; endTx++){
      setTx(s, endTx);
      assert(__LINE__, s->currState->tx == endTx);
    }
  }
  freeSk(s);
}

//Tests the function that sets the target y value.
void testSetTy(){
  sk *s = newSk();
  bool call;
  //Tests that setting target y works for all combinations
  //of a starting ty value and a final ty value.
  for(int callDy = 0; callDy <=1; callDy++){
    call = callDy == 0;
    for(int startTy = 0; startTy <= MAX_HEIGHT; startTy++){
      setTy(s, startTy, call);
      assert(__LINE__, s->currState->ty == startTy);
      if(call) assert(__LINE__, getOpcode(s->last->in) == DY);
      else assert(__LINE__, getOpcode(s->last->in) != DY);
      for(int endTy = 0; endTy <= MAX_HEIGHT; endTy++){
        setTy(s, endTy, call);
        assert(__LINE__, s->currState->ty == endTy);
        if(call) assert(__LINE__, getOpcode(s->last->in) == DY);
        else assert(__LINE__, getOpcode(s->last->in) != DY);
      }
    }
  }
  freeSk(s);
}

//Tests the function that copies the state of an object but none of the instructions.
