  assert(__LINE__, ins->currState->tool == insToCpy->currState->tool && ins->currState->start == insToCpy->currState->start);
  assert(__LINE__, ins->currState->data == insToCpy->currState->data && ins->currState->end == insToCpy->currState->end);
