//Tests that a given image produces a potentially valid rle x struct.
void testRleXHelper(image *img, bool isBandsPgm){
  int currX;
  rleX * xRle = getRleXFromImg(img);
  bool isEnd;
  float prevVal;
  for(int y = 0; y < MAX_HEIGHT; y++){
    prevVal = xRle->bright[y][0];
    currX = 0;
    isEnd = false;
    //Checks for bands pgm that each row is encoded correctly
    if(isBandsPgm){
      assert(__LINE__, xRle->runLen[y][0] == MAX_WIDTH && xRle->bright[y][0] != EMPTY_RLE);
    }
    for(int x = 0; (x < MAX_WIDTH) && !isEnd; x++){
      if(xRle->runLen[y][x] == EMPTY_RLE){
        isEnd = true;
        //Checks that remaining values are empty
        for(int i = x; i < MAX_WIDTH; i++){
          assert(__LINE__, xRle->bright[y][x] == EMPTY_RLE && xRle->runLen[y][x] == EMPTY_RLE);
        }
      }else{
        currX += xRle->runLen[y][x];
        //Checks that the previous run has a different brightness to current run.
        if(x != 0) assert(__LINE__, xRle->bright[y][x] != prevVal);
        prevVal = xRle->bright[y][x];
      }
    }
    assert(__LINE__, currX == MAX_WIDTH);//Checks that pixels [0, MAX_WIDTH - 1] are encoded
  }
  freeRleX(xRle);
}

//Creates an image to test rle encoding.
void testRleXOnExample(){
  //Creates a handmade image and tests that encoding works correctly on it.
  image* img;
  rleX* xRle;
  img = newImage();
  for(int y = 0; y < MAX_HEIGHT; y++){
    if(y != 0){
      for(int x = 0; x < MAX_WIDTH; x++){//Resets previous row encoding
        img->pixels[y - 1][x] = 0.0f;
      }
    }
    //Sets row values
    img->pixels[y][0] = 0.9; img->pixels[y][1] = 0.9;img->pixels[y][2] = 0.9;
    img->pixels[y][3] = 0.2; img->pixels[y][4] = 0.2;
    img->pixels[y][5] = 0.11;
    img->pixels[y][MAX_WIDTH - 2] = 0.4; img->pixels[y][MAX_WIDTH - 1] = 0.4;
    xRle = getRleXFromImg(img);//Encodes image
    //Test encoding is correct
    assert(__LINE__, xRle->bright[y][0] == 0.9f && xRle->runLen[y][0] == 3);
    assert(__LINE__, xRle->bright[y][1] == 0.2f && xRle->runLen[y][1] == 2);
    assert(__LINE__, xRle->bright[y][2] == 0.11f && xRle->runLen[y][2] == 1);
    assert(__LINE__, xRle->bright[y][3] == 0.0f && xRle->runLen[y][3] == MAX_WIDTH - 8);
    assert(__LINE__, xRle->bright[y][4] == 0.4f && xRle->runLen[y][4] == 2);
    //Asserts rest of encoding is correct
    for(int x = 5; x < MAX_WIDTH; x++){
      assert(__LINE__, xRle->bright[y][x] == EMPTY_RLE && xRle->runLen[y][x] ==  EMPTY_RLE);
    }
    //Tests that other rows are correctly encoded.
    for(int h = 0; h < MAX_HEIGHT; h++){
      if(h != y){
        assert(__LINE__, xRle->bright[h][0] == 0.0f && xRle->runLen[h][0] == MAX_WIDTH);
        for(int w = 1; w < MAX_WIDTH; w++){
          assert(__LINE__, xRle->bright[h][w] == EMPTY_RLE && xRle->runLen[h][w] == EMPTY_RLE);
        }
      }
    }
    freeRleX(xRle);
  }
  freeImage(img);
}

