//Tests that the name is actually of the form $.sk and points to a real file.
// Where $ contains no dots.
void testValidSkFileName(){
  FILE *fp;
  //Creates a list of file names to test
  const int LEN_F_NAMES = 10;
  const char * F_NAMES [] = {"H9Hzhmqsv.sk","9cJBG4yyQ.sk","29pxc5TnkL.sk", "mWeCIxogQ.sk", "3fctd2IDSS.sk"
  ,"o4xQ.sk","w8uQ2PE16asdf.sk", "qKjcDOJ.sk", "mWeCIx1ogQ.sk", "SaM4n9y.sk"};
  const char* F_INVALID_NAMES_EXIST [] = {"a", ".sk","al.as.sk","mWeCIxogQ", "3fctd2IDSS", "o4xQ",
  "w8uQ2PE16asdf", "qKjcDOJ", "mWeCIx1ogQ","f"};
  const char * F_NAMES_DONT_EXIST [] = {"H9Hzhmqsv.sk","9cJBG4yyQ.sk","29pxc5TnkL.sk", "mWeCIxogQ.sk", "3fctd2IDSS.sk"
  ,"o4xQ.sk","w8uQ2PE16asdf.sk", "qKjcDOJ.sk", "mWeCIx1ogQ.sk", "SaM4n9y.sk"};
  //Tests that valid filenames work
  for(int i = 0; i < LEN_F_NAMES; i++){
    //Tests that valid filenames are treated as valid
    fp = fopen(F_NAMES[i], "rb");
    if(fp == NULL){
      fp = fopen(F_NAMES[i], "wb");
      fclose(fp);
      assert(__LINE__, isValidSkFileName(F_NAMES[i]));
      remove(F_NAMES[i]);
    }else{
      assert(__LINE__, isValidSkFileName(F_NAMES[i]));
      fclose(fp);
    }
    //Tests that invalid filenames are treated as invalid (where the files do exist but are not.sk files)
    fp = fopen(F_INVALID_NAMES_EXIST[i], "rb");
    if(fp == NULL){
      fp = fopen(F_INVALID_NAMES_EXIST[i], "wb");
      fclose(fp);
      assert(__LINE__, !isValidSkFileName(F_INVALID_NAMES_EXIST[i]));
      remove(F_INVALID_NAMES_EXIST[i]);
    }else{
      assert(__LINE__, !isValidSkFileName(F_INVALID_NAMES_EXIST[i]));
      fclose(fp);
    }
    //Tests that invalid filenames are treated as invalid (where the files do not exist but are valid names)
    fp = fopen(F_NAMES_DONT_EXIST[i], "rb");
    if(fp == NULL){
      assert(__LINE__, !isValidSkFileName(F_NAMES_DONT_EXIST[i]));
    }else{
      fclose(fp);
    }
  }
}

//Writes an array to a file
void writeSkArrToFile(const char FILE_NAME[], int len, const unsigned char arr[len]){
  FILE *fp = fopen(FILE_NAME, "wb");
  for(int i = 0; i < len; i++){
    fputc(arr[i], fp);
  }
  fclose(fp);
}

