//Tests that the sk file contents are valid.
//Valid sk files may be empty. If the file is not empty, each byte must obey the following rules:
//If the first two bits are 10, then the remaining six bits (when intepreted as an unsigned integer)
// must not exceed the value of 8. If the first two bits are different, the byte is valid.
void testValidSkFileContent(){
  checkValidContentsSketchs();
  FILE *fp;
  //Creates a list of file names to test
  bool isValid;
  const int LEN_F_NAMES = 10;
  const char * F_NAMES [] = {"H9Hzhmqsv.sk","9cJBG4yyQ.sk","29pxc5TnkL.sk", "mWeCIxogQ.sk", "3fctd2IDSS.sk"
  ,"o4xQ.sk","w8uQ2PE16asdf.sk", "qKjcDOJ.sk", "mWeCIx1ogQ.sk", "SaM4n9y.sk"};
  for(int i = 0; i < LEN_F_NAMES; i++){
    fp = fopen(F_NAMES[i], "rb");
    if(fp == NULL){
      //Checks that empty files are valid
      fp = fopen(F_NAMES[i],"wb");
      fclose(fp);
      assert(__LINE__, isValidSkFileContents(F_NAMES[i]));
      remove(F_NAMES[i]);
      //checks that all possible one byte sk files are valid
      for(int j = 0; j < 256; j++){
        isValid = ((getOpcode(j) == 2) && (getOperand(j) <= 8 && getOperand(j) >= 0)) || getOpcode(j) != 2;
        fp = fopen(F_NAMES[i],"wb");
        fputc(j, fp);
        fclose(fp);
        assert(__LINE__, isValidSkFileContents(F_NAMES[i]) == isValid);
        remove(F_NAMES[i]);
      }
    }else{
      fclose(fp);
    }
  }
}

