//Converts an array of bytes to an sk file
sk* getSkFromArr(int len, const unsigned char arr [len]){
  sk* ins = newSk();
  for(int i = 0; i < len; i++){
    addInstruction(ins, arr[i]);
  }
  return ins;
}


